    levelToText = (level) => {
        switch (level) {
            case 'green': return 'Very Easy'
            case 'greenBlue': return 'Easy'
            case 'blue': return 'Average'
            case 'blueBlack': return 'Difficult'
            case 'black': return 'Very Difficult'
            default: return 'N/A'
        }
    }

    classByLevel = (level) => {
        switch (level) {
